escapes.expr:
{
	var h = new haxe.ds.StringMap();
	h.set("lt", "<");
	h.set("gt", ">");
	h.set("amp", "&");
	h.set("quot", "\"");
	h.set("apos", "'");
	h;
}

m.e:
{
	var h = new haxe.ds.StringMap();
	h.set("lt", "<");
	h.set("gt", ">");
	h.set("amp", "&");
	h.set("quot", "\"");
	h.set("apos", "'");
	h;
}

converts.haxe_doc:
Custom list of converts that should be used in FileSystem.
		Should be added in hxml `--macro` to ensure proper function.
		Example of adding a Convert:
		```haxe
		static function initCustomConverts() {
			hxd.fs.Convert.converts.push("path.to.my.Convert");
			hxd.fs.Convert.converts.push("path.to.my.OtherConvert");
		}
		```
		Adn in hxml:
		`--macro path.to.my.MacroScript.initCustomConverts()`

add.haxe_doc:
Adds new listeners to the list.
    @param priority A priority of the listener. Higher priority listeners are called first. Same priority events are called on first-come-first-served basis.
    @param once If true, will trigger listener only once and then automatically unsubscribe from the list.
